def update(arr):
    result = [[" " for q in b] for b in arr]
    changed = False
    for i in range(len(arr)):
        for j in range(len(arr[i])):
            count = 0
            # This code is intentionally loop unrolled for efficiency (~2s time saved)
            x = 1
            y = 1
            while i + x < len(arr) and j + y < len(arr[i + x]) and arr[i + x][j + y] == ".":
                x += 1
                y += 1
            if i + x < len(arr) and j + y < len(arr[i + x]) and arr[i + x][j + y] == "#":
                count += 1

            x = 1
            while i + x < len(arr) and arr[i + x][j] == ".":
                x += 1
            if i + x < len(arr) and arr[i + x][j] == "#":
                count += 1
                
            x = 1
            y = -1
            while i + x < len(arr) and 0 <= j + y and arr[i + x][j + y] == ".":
                x += 1
                y += -1
            if i + x < len(arr) and 0 <= j + y and arr[i + x][j + y] == "#":
                count += 1
                
            y = 1
            while j + y < len(arr[i]) and arr[i][j + y] == ".":
                y += 1
            if j + y < len(arr[i]) and arr[i][j + y] == "#":
                count += 1
                
            y = -1
            while 0 <= j + y and arr[i][j + y] == ".":
                x += 1
                y += -1
            if 0 <= j + y and arr[i][j + y] == "#":
                count += 1
            
            x = -1
            y = 1
            while 0 <= i + x and j + y < len(arr[i + x]) and arr[i + x][j + y] == ".":
                x += -1
                y += 1
            if 0 <= i + x and j + y < len(arr[i + x]) and arr[i + x][j + y] == "#":
                count += 1

            x = -1
            while 0 <= i + x and arr[i + x][j] == ".":
                x += -1
            if 0 <= i + x and arr[i + x][j] == "#":
                count += 1
                
            x = -1
            y = -1
            while 0 <= i + x and 0 <= j + y and arr[i + x][j + y] == ".":
                x += -1
                y += -1
            if 0 <= i + x and 0 <= j + y and arr[i + x][j + y] == "#":
                count += 1
            
            if arr[i][j] == "L" and count == 0:
                result[i][j] = "#"
                changed = True
            elif arr[i][j] == "#" and count >= 5:
                result[i][j] = "L"
                changed = True
            else:
                result[i][j] = arr[i][j]

    return changed, result
    

